        title: 'Recipe Generator',
        mockupPath: '/assets/work/recipe/desktop-mockup.png',
        deployedLink: 'https://mreliwood.github.io/demo-recipe-generator/',
        repoLink: 'https://github.com/MrEliWood/demo-recipe-generator',
        team: [
            {
                name: 'Eli Wood',
                role: 'Project Manager'
            },
            {
                name: 'Hannah Callison',
                role: 'Git Admin'
            },
            {
                name: 'Joe Choe',
                role: ''
            },
            {
                name: 'Jonathan Tran',
                role: ''
            }
        ],
        tools: [
            'HTML',
            'CSS',
            'Javascript',
            'jQuery',
            'TheMealDB API',
            'TheCocktailDB API'
        ],
        time: '1 Week'
    }

    // Porefection
    const porefection = {
        id: 2,
        title: 'Porefect Skincare',
        mockupPath: '/assets/work/porefection/desktop-mockup.png',
        deployedLink: 'https://porefect.herokuapp.com',
        repoLink: 'https://github.com/jittel/combo-skincare',
        team: [
            {
                name: 'Isis Alexander',
                role: 'Project Manager'
            },
            {
                name: 'Nate Ginn',
                role: 'Git Admin'
            },
            {
                name: 'Eli Wood',
                role: ''
            },
            {
                name: 'Jaden Storey',
                role: ''
            }
        ],
        tools: [
            'HTML',
            'CSS',
            'Javascript',
            'node.js',
            'Express.js',
            'MySQL 2',
            'Sequelize',
            'bcrypt',
            'Cloudinary'
        ],
        time: '1 Week'
    }

    // Weather Dashboard
    const weatherDashboard = {
        id: 3,
        title: 'Weather Dashboard',
        mockupPath: '/assets/work/weather/desktop-mockup.png',
        deployedLink: 'https://demo-weather-dashboard.herokuapp.com',
        repoLink: 'https://github.com/MrEliWood/demo-weather-dashboard',
        team: [
            {
                name: 'Solo',
                role: ''
            }
        ],
        tools: [
            'HTML',
            'CSS',
            'Javascript',
            'node.js',
            'Google Maps API',
            'OpenWeather API'
        ],
        time: '1 Week'
    }

    // Blog Template
    const blogTemplate = {
        id: 4,
        title: 'Blog Template',
        mockupPath: '/assets/work/blog/desktop-mockup.png',
        deployedLink: 'http://demo-blog-template.herokuapp.com/',
        repoLink: 'https://github.com/MrEliWood/blog-template',
        team: [
            {
                name: 'Solo',
                role: ''
            }
        ],
        tools: [
            'HTML',
            'CSS',
            'Javascript',
            'node.js',
            'Express.js',
            'MySQL 2',
            'Sequelize',
            'bcrypt'
        ],
        time: '1 Week'
    }

    return (

        <div className="page">

            <Project project={recipeGenerator} />
            <Project project={weatherDashboard} />
            <Project project={blogTemplate} />
            <Project project={porefection} />

        </div>

    );

};

export default Work;
